import React from 'react';
import './ResultsScreen.css';

import homeIcon from '../assets/home_icon.png';
import restartIcon from '../assets/restart_icon.png';
import addIcon from '../assets/add_icon.png';

const ResultsScreen = ({ onBackToMenu, scores = {}, sessionData, playerId }) => {
    const players = sessionData ? sessionData.players : [];
    const mode = sessionData ? sessionData.settings.mode : 'Competitive';

    // Process Data
    const results = players.map(p => ({
        id: p.id,
        name: p.name,
        score: scores[p.id] || 0,
        words: 0, // Words count tracked elsewhere? For now 0
        isMe: p.id === playerId,
        teamId: p.teamId
    })).sort((a, b) => b.score - a.score);

    // Assign Ranks (handling ties strictly or simply 1..n)
    const rankedResults = results.map((p, idx) => ({
        ...p,
        rank: idx + 1
    }));

    // Find My Rank
    const myResult = rankedResults.find(p => p.isMe);
    const myRank = myResult ? myResult.rank : '-';

    // Display Logic
    let displayList = rankedResults.slice(0, 10);
    // If I'm not in top 10, add me
    if (myResult && myRank > 10) {
        displayList.push(myResult);
    }

    const getRankSuffix = (n) => {
        if (!n) return '';
        const j = n % 10, k = n % 100;
        if (j === 1 && k !== 11) return "st";
        if (j === 2 && k !== 12) return "nd";
        if (j === 3 && k !== 13) return "rd";
        return "th";
    };

    const getTeamStyle = (teamId) => {
        if (!teamId) return {};
        const colors = ['#ff007f', '#ffffff', '#CD853F', '#00ff00'];
        return { color: colors[teamId - 1] };
    };

    return (
        <div className="results-screen fade-in">
            {/* Header Section */}
            <div className="results-header">
                <h1 className="game-over-title">GAME OVER</h1>
                <p className="congrats-text">
                    {/* Dynamic Text based on rank */}
                    {myRank === 1 ?
                        "CONGRATS! YOU FINISHED 1ST, PIGGY SUPREME!" :
                        `YOU FINISHED ${myRank}${getRankSuffix(myRank)}. GOOD EFFORT!`}
                </p>

                {/* Action Icons */}
                <div className="result-actions">
                    <button className="icon-btn" onClick={onBackToMenu}>
                        <img src={homeIcon} alt="Home" />
                    </button>
                    <button className="icon-btn" onClick={() => window.location.reload()}>
                        <img src={restartIcon} alt="Restart" />
                    </button>
                </div>
            </div>

            {/* Main Content: Table Centered */}
            <div className="results-content">
                {/* Leaderboard Table */}
                <div className="results-leaderboard-container">
                    <div className="table-header">
                        <div className="col rank">Rank</div>
                        <div className="col name">Name</div>
                        <div className="col score">Score</div>
                    </div>

                    <div className="table-body">
                        {displayList.map((player) => (
                            <div
                                key={player.id}
                                className={`table-row ${player.isMe ? 'highlight' : ''}`}
                            >
                                <div className="col rank" style={player.isMe ? { color: '#D81B60' } : {}}>
                                    {player.rank}{getRankSuffix(player.rank)}
                                </div>
                                <div
                                    className="col name"
                                    style={mode === 'Teams' ? getTeamStyle(player.teamId) : (player.isMe ? { color: '#D81B60' } : {})}
                                >
                                    {player.name} {mode === 'Teams' && `(T${String.fromCharCode(64 + player.teamId)})`}
                                </div>
                                <div className={`col score ${player.isMe ? 'text-pink' : ''}`}>
                                    {player.score}
                                </div>
                            </div>
                        ))}
                    </div>
                </div>
            </div>
        </div>
    );
};

export default ResultsScreen;
